import React, { Component } from "react";
import "./MovieTag.scss";

class MovieTag extends Component {


  render() {
    return (
      <div className="movie-tag">
        <div className="play-button"><img src={process.env.PUBLIC_URL + "Images/playbutton.png"} alt=""/></div>
        <img
          src="https://image.tmdb.org/t/p/original/iXbWpCkIauBMStSTUT9v4GXvdgH.jpg"
          alt=""
        />
        <div className="movie-name">
          <p>P</p>
          <h3>The Suicide Squad</h3>
        </div>
        <div className="movie-release">
          <p>Language:en</p>
          <p>26/6/6</p>
        </div>
      </div>
    );
  }
}

export default MovieTag;
